import { useNavigate} from "react-router-dom";

function Home() {
    const navigate = useNavigate();
    const pages = ["contact","about"]
  return (

    <div className="Home">
        <h1>HOME PAGE</h1>
        <div className="nav" style={{display:"flex"}}>
             {pages.map(el=><p style={{margin:"10px",cursor:"pointer" }} onClick={()=>navigate(`/${el}`)}>{el.toLocaleUpperCase()}</p>)}
        </div>

    </div>
  );
}

export default Home;
